from collections import deque
#X = [1,2,3]
def countRight(X):
    stack = deque()

    for i in range(len(X)):
        while stack and stack[-1] <= X[i]:
            stack.pop()
        stack.append(X[i])

    total = len(stack)

    return total


print(countRight(X))
